// import logo from './logo.svg';
import './App.css';
import { Container } from 'react-dom';


function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

function Search(product) {
  return (
    <form>
      <p>Enter the name of the product </p>
      <input type="text" name={product.name}/> <br/>
      <button>Submit</button>
    </form>

  );
}
function Navbar() {
  return(
    <nav className="nav">
      <ul>
        <li>
          <a href="/">Shop</a>
          <a href="/">Pricing</a>
        </li>
      </ul>
    </nav>
  );

}

function App() {
  return (
    <div className="App">
      <Navbar />
      <header className="App-header">
        <Welcome name="User"/>
        <Search name="product" />
      </header>
    </div>
  );
}

export default App;
